import React from "react";
import { Tile } from '../tile/Tile';

export const TileList = ( arrayOfData
 ) => {
  return (
    <div>
      {arrayOfData.map( (object, index) => {
        return <Tile key={index} name={object.name} {...object} />
      } )}
    </div>
  );
};
